import { Home, Logout, PersonOutline } from "@mui/icons-material";
import { Tabs, Tab, Grid, Button } from "@mui/material";
import { useState } from "react";
const SideBar = () => {
  const [tabValue, setTabValue] = useState(0);
  const handleTabChange = (event, value) => {
    setTabValue(value);
  };
  return (
    <Grid direction="column" alignItems="end">
      <Tabs orientation="vertical" onChange={handleTabChange} value={tabValue}>
        <Tab icon={<Home />} label="Accueil" iconPosition="start" />
        <Tab icon={<PersonOutline />} label="Profil" iconPosition="start" />
      </Tabs>
      <Button>Deconnexion</Button>
    </Grid>
  );
};

export default SideBar;
